// ExerciseLibrary.js
import React from 'react';
import './ExerciseLibrary.css';
import frontSquat from './images/front-squat.jpg';

const exerciseData = [
  {
    muscle: "Legs",
    exercises: [
      { name: "Front Squat", image: frontSquat },
      { name: "Lunges", image: null },
      { name: "Leg Press", image: null },
      { name: "Leg Curl", image: null }
    ]
  },
  {
    muscle: "Back",
    exercises: [
      { name: "Pull-Up", image: null },
      { name: "Deadlift", image: null },
      { name: "Row", image: null },
      { name: "Lat Pulldown", image: null }
    ]
  },
  {
    muscle: "Chest",
    exercises: [
      { name: "Push-Up", image: null },
      { name: "Bench Press", image: null },
      { name: "Incline Press", image: null },
      { name: "Chest Fly", image: null }
    ]
  }
];

export default function ExerciseLibrary() {
  return (
    <div style={{ padding: "20px" }} dir="rtl">
      <h1>Exercise Library</h1>
      <table border="1" cellPadding="10" style={{ borderCollapse: "collapse", width: "100%" }}>
        <thead>
          <tr>
            <th>Muscle Group</th>
            <th>Exercise 1</th>
            <th>Exercise 2</th>
            <th>Exercise 3</th>
            <th>Exercise 4</th>
          </tr>
        </thead>
        <tbody>
          {exerciseData.map((group, index) => (
            <tr key={index}>
              <td style={{ fontWeight: "bold", backgroundColor: "#f0f0f0" }}>{group.muscle}</td>
              {group.exercises.map((exercise, i) => (
                <td key={i} style={{ textAlign: "center" }}>
                  <div>{exercise.name}</div>
                  {exercise.image ? (
                    <img
                      src={exercise.image}
                      alt={exercise.name}
                      style={{ width: "100px", height: "100px", objectFit: "cover" }}
                    />
                  ) : (
                    <div style={{ color: "gray", fontStyle: "italic", marginTop: "10px" }}>No image</div>
                  )}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
